</tr>  <tr>    <td width="15%" bgcolor="#EFE5E0">■内　容　量</td>    <td colspan="3" bgcolor="#FFFFFF">－</td>  </tr>  <tr>    <td bgcolor="#EFE5E0">■商品説明</td>    <td colspan="3" bgcolor="#FFFFFF">※この商品は外箱が破損、色褪せ、汚れております。<br>
      <br>
      ●質感と色の組み合わせで自由自在に楽しめる、4色入りアイシャドウ。</b><br>
      <br>4色の主張する色。美しいまなざしのために、今までにない生き生きとして軽快かつ強烈、創造力をかきたてるアイシャドウをクリエイトしました。使いやすく携帯にも便利。<br>2段式のコンパクトの上段にはアイカラーパレット、下段にはアプリケーター(シェーダー2本、アイライナーチップ1本)がセットされています。<br>
